local m = { 
    __index = function(t, k) 
        if k == "toObject" then
            return function()  
                local o = {}
                for key, v in pairs (__key_map) do 
                    o[key] = t._raw[v]
                end
                return o
            end 
        end
        
        assert(__key_map[k], "cannot find " .. k .. " in record_tombexplore_info")

        return t._raw[__key_map[k]]
    end
}


function tombexplore_info.getLength()
    return #tombexplore_info._data
end



function tombexplore_info.hasKey(k)
  if __key_map[k] == nil then
    return false
  else
    return true
  end
end


---
--@return @class record_tombexplore_info
function tombexplore_info.indexOf(index)
    if index == nil then
        return nil
    end
    return setmetatable({_raw = tombexplore_info._data[index]}, m)
end



---
--@return @class record_tombexplore_info
function tombexplore_info.get(stage_id)
    
    return tombexplore_info.indexOf(__index_stage_id[ stage_id ])
     
end



function tombexplore_info.set(stage_id, key, value)
    local record = tombexplore_info.get(stage_id)
    if record then
        local keyIndex = __key_map[key]
        if keyIndex then
            record._raw[keyIndex] = value
        end
    end
end




function tombexplore_info.get_index_data()
    return __index_stage_id 
end

return  tombexplore_info 